import router from "./router";
import { RouterProvider } from "react-router-dom"
import "./style.css"
import { PersistGate } from "redux-persist/integration/react";


function App() {
  return (
    <>
      <PersistGate>
        <RouterProvider router={router} />
      </PersistGate>
    </>
  )
}

export default App;
